import React, { Component } from "react";

export default class Navbar extends Component {

    render() {
        return (
            <nav className="Navbar">
                <div className="Logo">
                    Pp
                </div>
                <div className="Menu">
                    <div class="bar1"></div>
                    <div class="bar2"></div>
                    <div class="bar3"></div>
                </div>
            </nav>
        );
    }
}
